import React from 'react'

export default class Clock extends React.Component {
  constructor(props) {
    super(props)
    this.state = {date: new Date()}
  }

  render() {
    return (
      <div>
        <h2> Hey, it's {this.state.date.toLocaleTimeString()}</h2>
      </div>
    )
  }
}
